import '../src/FFservice.css';
import '../src/FFtrainer.css';
import '../src/FFfooter.css';
import '../src/index.css';
import FFabout from './components/FFabout';
import FFservice from './components/FFservice';
import FFtrainer from './components/FFtrainer';
import FFfooter from './FFfooter';



const App = () => {
  return (
    <>
    <FFheader />
    <FFabout/>  
    <FFservice/>
    <FFtrainer/>
    <FFfooter/>

    </>

  );
}

export default App;
